import React from "react";

export function PostLike({ post }){
    console.log("from like page",post);
    return (
        <div>
            <div className="caption"> {post.desc} </div>
            <span className="likes" role="img">
                <button
                    style={{
                    fontWeight: "bolder",
                    backgroundColor: "gray",
                    color: "white",
                    padding:"5px"
                    }}
                    //onClick={() => dispatch(LikesClicked(postElement._id))}
                >
                    Like {post.likes.length}
                </button>
            </span>
        </div>
    )
}
